    <div
      style={{
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        height: "50vh",
      }}
    >
      <input
        style={{ padding: 10, borderRadius: 10, margin: 10, fontSize: 20 }}
        placeholder="Enter Student Class"
      />
      <input
        style={{ padding: 10, borderRadius: 10, margin: 10, fontSize: 20 }}
        placeholder="Enter Student Name"
      />
    </div>
  );
};

export default DeleteStudent;
